window.bookSummaryJSON = "<p>Tucked away in a remote corner of North Carolina's Fort Bragg, behind rows of razor wire and heavily armed guards, lies the headquarters of the nation's most elite counter-terrorism unit: the United States Army's 1st Special Forces Operational Detachment Delta. Here, a brilliant new approach to combating terrorism has just been born. Its codename: The Athena Project. </p> <p>The novels will follow an elite team of female warriors from their recruitment as top-level athletes, through their training, to their deployment on some of the most exciting and dangerous international assignments the fiction world has ever seen. </p> <p>Brad Thor's listeners will be electrified as he employs his vast knowledge of covert operations and military intrigue to bring to life his most heart-pounding, globe-trotting thrillers yet.</p>"; 
